import React from "react";
import { Typography, Box, Button, Container, Grid, Card, CardContent } from "@mui/material";

// Recursive component for rendering sections
const RecursiveSectionRenderer = ({ sections, depth = 0 }) => {
  // Base case: if no more sections, return null
  if (!sections || sections.length === 0) return null;

  // Current section to render
  const currentSection = sections[0];

  // Recursive rendering logic
  const renderSection = () => {
    switch (currentSection.type) {
      case 'hero':
        return (
          <Box
            sx={{
              position: "relative",
              height: "100vh",
              backgroundImage: `url('${currentSection.backgroundImage}')`,
              backgroundSize: "cover",
              backgroundPosition: "center",
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
              justifyContent: "center",
              textAlign: "center",
            }}
          >
            <Typography
              variant="h2"
              sx={{
                fontWeight: "bold",
                fontFamily: "'Syne', sans-serif",
                textShadow: "2px 2px 8px rgba(0, 0, 0, 0.7)",
                color: "#484237",
              }}
            >
              {currentSection.title}
            </Typography>
            <Typography
              variant="subtitle1"
              sx={{
                mt: 2,
                fontSize: "1.2rem",
                fontStyle: "italic",
                textShadow: "1px 1px 6px rgba(0, 0, 0, 0.5)",
                color: "#484237",
              }}
            >
              {currentSection.subtitle}
            </Typography>
            <Box sx={{ mt: 4 }}>
              <Button
                variant="contained"
                sx={{
                  px: 4,
                  py: 2,
                  borderRadius: "30px",
                  backgroundColor: "#D3C5B6",
                  color: "#484237",
                  boxShadow: "0px 4px 10px rgba(211, 197, 182, 0.5)",
                  "&:hover": {
                    backgroundColor: "#B2A599",
                  },
                }}
              >
                {currentSection.buttonText}
              </Button>
            </Box>
          </Box>
        );

      case 'about':
        return (
          <Container sx={{ py: 8, backgroundColor: "#D3C5B6", borderRadius: "10px", color: "#484237" }}>
            <Typography variant="h4" align="center" gutterBottom sx={{ fontWeight: "bold", mb: 4 }}>
              {currentSection.title}
            </Typography>
            <Typography variant="body1" align="center" sx={{ fontSize: "1.1rem", mb: 6 }}>
              {currentSection.description}
            </Typography>
          </Container>
        );

      case 'features':
        return (
          <Container sx={{ py: 6, backgroundColor: "#D3C5B6", borderRadius: "10px", color: "#484237" }}>
            <Typography variant="h4" align="center" sx={{ mb: 4, fontWeight: "bold" }}>
              {currentSection.title}
            </Typography>
            <Grid container spacing={4}>
              {currentSection.features.map((feature, index) => (
                <Grid item xs={12} sm={6} md={4} key={index}>
                  <Card sx={{ boxShadow: 3, textAlign: "center", p: 3, backgroundColor: "#B2A599" }}>
                    <img
                      src={feature.image}
                      alt={feature.title}
                      style={{ marginBottom: "16px", borderRadius: "50%" }}
                    />
                    <Typography variant="h6" sx={{ fontWeight: "bold", mb: 1 }}>
                      {feature.title}
                    </Typography>
                    <Typography variant="body2" sx={{ color: "#484237" }}>
                      {feature.description}
                    </Typography>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Container>
        );

      case 'cta':
        return (
          <Box
            sx={{
              py: 8,
              backgroundColor: "#484237",
              color: "#D3C5B6",
              textAlign: "center",
            }}
          >
            <Typography
              variant="h5"
              sx={{
                fontWeight: "bold",
                mb: 2,
              }}
            >
              {currentSection.title}
            </Typography>
            <Button
              variant="contained"
              sx={{
                px: 4,
                py: 2,
                borderRadius: "30px",
                backgroundColor: "#B2A599",
                color: "#484237",
                fontWeight: "bold",
                boxShadow: "0px 4px 10px rgba(178, 165, 153, 0.5)",
                "&:hover": {
                  backgroundColor: "#D3C5B6",
                },
              }}
            >
              {currentSection.buttonText}
            </Button>
          </Box>
        );

      default:
        return null;
    }
  };

  return (
    <>
      {renderSection()}
      {/* Recursively render the next sections */}
      <RecursiveSectionRenderer 
        sections={sections.slice(1)} 
        depth={depth + 1} 
      />
    </>
  );
};

const DashboardPage = () => {
  // Define sections using a data-driven approach
  const sections = [
    {
      type: 'hero',
      title: 'Welcome to CautisCloud',
      subtitle: 'Decentralized Cloud Storage for Security and Privacy',
      backgroundImage: 'D:/SecureCloud/frontend/images/btrzwpb.jpg',
      buttonText: 'Login'
    },
    {
      type: 'about',
      title: 'CautisCloud: Secure Your Digital Assets',
      description: 'CautisCloud is a safe and secure cloud storage platform that prioritizes security, offering a seamless and intuitive experience for protecting your digital assets. Our encryption and decentralized architecture ensure your data is always safe and accessible.'
    },
    {
      type: 'features',
      title: 'Key Features',
      features: [
        {
          title: 'File Splitting',
          description: 'Your files are broken into smaller chunks for secure storage and distribution.',
          image: 'https://via.placeholder.com/150'
        },
        {
          title: 'Node Distribution',
          description: 'Files are stored across multiple nodes, ensuring reliability and redundancy.',
          image: 'https://via.placeholder.com/150'
        },
        {
          title: 'IPFS Hashing',
          description: 'Unique IPFS hashes ensure your data is tamper-proof and secure.',
          image: 'https://via.placeholder.com/150'
        }
      ]
    },
    {
      type: 'cta',
      title: 'Ready to get started with CautisCloud?',
      buttonText: 'Sign Up Now'
    }
  ];

  return (
    <Box sx={{ backgroundColor: "#B2A599", color: "#484237", minHeight: "100vh" }}>
      <RecursiveSectionRenderer sections={sections} />
    </Box>
  );
};

export default DashboardPage;
